import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import "./App.css";
import DrivesPage from "./pages/drives/DrivesPage";
import Login from "./pages/auth/Login";

// Protected route component
const ProtectedRoute = ({ children }: { children: React.ReactNode }) => {
  const authToken = localStorage.getItem("authToken");

  if (!authToken) {
    // Redirect to login if not authenticated
    return <Navigate to="/login" replace />;
  }

  return <>{children}</>;
};

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  useEffect(() => {
    // Check if user is authenticated
    const authToken = localStorage.getItem("authToken");
    setIsAuthenticated(!!authToken);
  }, []);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Navigate to={isAuthenticated ? "/drives" : "/login"} replace />} />
        <Route path="/login" element={<Login />} />
        <Route path="/drives" element={
          <ProtectedRoute>
            <DrivesPage />
          </ProtectedRoute>
        } />
        {/* Additional routes will be added in future batches */}
      </Routes>
    </Router>
  );
}

export default App;

// Types for RecruitHub application

// College types
export interface CollegeResponseDto {
  collegeId: string;
  name: string;
  city: string;
  isDeleted: boolean;
  createdTimestamp: string;
  updatedTimestamp: string;
}

export interface PaginationMetaDto {
  totalItems: number;
  itemsPerPage: number;
  currentPage: number;
  totalPages: number;
}

export interface PaginatedCollegeResponseDto {
  items: CollegeResponseDto[];
  meta: PaginationMetaDto;
}

// Drive types
export interface SecondarySpocDto {
  spocId: string;
  spocEmail: string;
  spocName: string;
}

export interface EvaluationCriteriaDto {
  criteriaId?: string;
  name: string;
  description?: string;
  ratingType: 'percentage' | 'scale-5' | 'scale-10' | 'yes-no' | 'text';
  isRequired: boolean;
}

export interface RoundDto {
  roundNumber: number;
  name: string;
  startTime: string;
  endTime: string;
  evaluationCriteria: EvaluationCriteriaDto[];
}

export interface DriveDocument {
  driveId: string;
  name: string;
  collegeId: string;
  collegeName: string;
  role: 'Associate Engineer' | 'Business Analyst';
  practice: 'Application Development' | 'DevOps' | 'PMO' | 'BaUX';
  startDate: string;
  primarySpocId: string;
  primarySpocEmail: string;
  primarySpocName: string;
  secondarySpocs?: SecondarySpocDto[];
  isPinned: boolean;
  isCompleted: boolean;
  isActive: boolean;
  wecpTestIds?: string[];
  rounds?: RoundDto[];
  createdTimestamp: string;
  updatedTimestamp: string;
  // UI display properties
  studentCount?: number;
  activeRound?: number;
}

export interface PaginatedDriveResponse {
  drives: DriveDocument[];
  total: number;
  page: number;
  limit: number;
}

// Create Drive DTO
export interface CreateDriveDto {
  name: string;
  collegeId: string;
  collegeName: string;
  role: 'Associate Engineer' | 'Business Analyst';
  practice: 'Application Development' | 'DevOps' | 'PMO' | 'BaUX';
  startDate: string;
  primarySpocId: string;
  primarySpocEmail: string;
  primarySpocName: string;
  secondarySpocs?: SecondarySpocDto[];
  isPinned?: boolean;
  isCompleted?: boolean;
  rounds?: RoundDto[];
}

// Panel types
export interface PanelMemberDto {
  employeeId: string;
  emailId: string;
  name: string;
}

export interface Panel {
  panelId: string;
  primaryPanelMember: PanelMemberDto;
  additionalPanelMembers?: PanelMemberDto[];
  name?: string;
  createdAt: string;
  updatedAt: string;
}

export interface CreatePanelDto {
  primaryPanelMember: PanelMemberDto;
  additionalPanelMembers?: PanelMemberDto[];
  name?: string;
}

import axios from 'axios';

// Create axios instance with base URL and default headers
const api = axios.create({
  baseURL: 'http://localhost:8000/api',
  headers: {
    'Content-Type': 'application/json',
  },
});

// Add authorization header to every request
api.interceptors.request.use(
  (config) => {
    // Get token from localStorage or use hardcoded token
    const token = localStorage.getItem('authToken') || 'cde7ac9e2f9b7950690b0b44c031309591de0ae033976d762c1b220c02b4614b';
    config.headers.Authorization = `Bearer ${token}`;
    return config;
  },
  (error) => {
    return Promise.reject(error);
  }
);

export default api;

